import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css'; // For styling the navbar
import './HomePage.css'; // For styling the HomePage buttons (optional)

// The Navbar component
const Navbar = () => {
  return (
    <nav className="navbar">
      <ul className="nav-list">
        <li>
          <Link to="/" className="nav-link">Home</Link>
        </li>
        <li>
          <Link to="/orders" className="nav-link">Orders</Link>
        </li>
        <li>
          <Link to="/news" className="nav-link">News</Link>
        </li>
        <li>
          <Link to="/contact" className="nav-link">Contact</Link>
        </li>
        <li>
          <Link to="/about" className="nav-link">About</Link>
        </li>
      </ul>
    </nav>
  );
};

const HomePage = () => {
  return (
    <div>
      {/* Render the Navbar */}
      <Navbar />

      {/* Main Content of the HomePage */}
      <h1>Welcome to the Order Management System</h1>

      <form className="div">
        <div>
          <Link to="/customerorder">
            <center>
              <button className="CustomerOrderButton">Customer Order</button>
            </center>
          </Link>
        </div>
        <br />
        <div>
          <Link to="/adminorder">
            <center>
              <button className="AdminOrderButton">Admin Order</button>
            </center>
          </Link>
        </div>
      </form>
    </div>
  );
};

export default HomePage;
